import { Container, Button } from 'react-bootstrap';
import './App.css';
import NavBar from './NavBar';

function App() {
  return (
    <>
      <NavBar />
      <Container>
        <Button>On</Button>
        <Button>Off</Button>
      </Container>
    </>
  );
}

export default App;
